import Vikings from '../Video/Vikings.mp4';
import Got from '../Video/got.mp4';
import { Player, ControlBar,PlaybackRateMenuButton,VolumeMenuButton } from 'video-react';


const HeaderPart = () => {
    return (
        <React.Fragment>
            <Player playsInline width={100} height={50} fluid={false}>
                <source src={Vikings} />
                <ControlBar>
                    <PlaybackRateMenuButton rates={[2, 1.5, 1]} order={7.1} />
